window.bookSummaryJSON = "<p>Dive through the looking-glass into a Wonderland that's lush, exhilarating...and deadly.</p> <p>Five steps to getting over a nasty break-up:</p> <p>One: Inherit a mini-castle from your reclusive grand-aunt. Two: Fall through a mirror into a decadent upside-down world. Three: Get to know the smoking-hot locals. Prickly Hatter. Playful Chess. And the passionate White Knight.... Wait, what was I talking about? Oh, right. Four: Discover you possess powers that could win a rebellion against a tyrannical queen. Five: Keep a tight hold on your head - and your heart.</p> <p>When I tumbled into Wonderland, I only wanted to escape the epic mess my life had become. I'm not sure I can trust anything in this bizarre, intoxicating place. But the three incredibly enticing men I've met here might need me even more than anyone back home ever has.</p> <p>Maybe a little heroism is all it'll take to heal my wounds and theirs. As long as the Queen of Hearts doesn't come for our heads first...</p> <p>Contains mature themes.</p>"; 
